Tesla Model 3 Standart Range Plus от Moscow Tesla Club.

Автомобиль новый, без пробега. Европейская версия (пробег - в километрах, температура - в градусах Цельсия, активирована навигация).
Европейская гарантия на электромобиль - 4 года или 80.000 км, гарантия на батарею - 8 лет.
----

Разгон до 100 км/ч за 5, 6 сек.;
Максимальная скорость: 225 км/ч;
Мощность 258 л.с.;
Запас хода: 409 км по WLTP;
Задний привод.

ЭКСТЕРЬЕР
Цвет кузова: белый;
Панорамная стеклянная крыша;
Легкосплавные колесные диски R18 Aero Wheels Design.

ИНТЕРЬЕР
Премиум пакет (салон из высококачественных материалов, подогрев передних сидений, салонное зеркало заднего вида с авто-затемнением, обогрев боковых зеркал заднего вида, эл. складывающиеся боковые зеркала заднего вида, регулируемые электрические сидения по 12-ти направлениям, USB разъёмы,
премиальная саунд система).

ОПЦИИ
Автопилот версии 3.0;
Система автоматического аварийного торможения и предупреждения о столкновении;
8 подушек безопасности;
ESP и Traction контроль;
15" сенсорный дисплей с навигационной системой";
Доступ в салон без ключа (keyless entry), пластиковая карта вместо традиционного ключа;
Голосовое управление;
60/40 складывающиеся сидения второго ряда.

Tesla в первую очередь выпускает новинку для текущих владельцев других моделей, а Moscow Tesla Club объединяет сотни владельцев. Поэтому у нас приоритет в очереди на Model 3 среди огромного количества предзаказов со всего мира! Кроме Long Range у нас Вы можете заказать Tesla Model 3 и в другой комплектации, Long Range, Performance, по ценам от 4 000 000 рублей.
---
*Электромобиль оборудован Устройством Вызова Экстренных Оперативных Служб (УВЭОС) ЭРА ГЛОНАСС*.

Электромобиль полностью совместим с российскими сетями электропитания 220В, 11/22 кВт. скорость зарядки от домашней зарядной станции до 4 часов.
